- input: "TEXT\x1CC00167130\x1CTEXT-00001\x1C\x1CF3XA\x1CThe Committee is in receipt
    of the Commissions Request for Further Information dated 5/4/2011 regarding the
    following 3 items:  1. The contribution from Cozen O'Connor Political Action Committee
    on 10/13/2010.  Upon review of the PAC's FEC Report and discussions with the Committee
    it was discovered that the PAC reported the contribution to PA Victory 2010 which
    is actually the name of the bank account and a project name of the Pennsylvania
    Democratic Party. -  2. In regards to the excessive contributions disclosed on
    the above referenced report from Matthew Balitsaris and Joseph M. Field, the excessive
    funds for both of these donors were reattributed to their spouses in writing within
    60 Days and disclosed on the committees Year End Report for 2010.  The excessive
    portion of Taking the Hill PAC was refunded and disclosed on the Year End Report
    for 2010.  - 3. The committee inadvertently left off the supporting candidate
    information on the two Schedule F expenditures previously reported.  This amended
    report clarifies that information.  \n"
